import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Navbar = () => {
  return (
    <nav className="w-full bg-white border-b shadow-md fixed top-0 z-50">
      <div className="max-w-7xl mx-auto flex justify-between items-center p-4">
        {/* Logo */}
        <div className="text-4xl custom-font font-bold text-blue-500">
          Vividly
        </div>

        {/* Navigation */}
        <div className="flex space-x-6">
          <NavItem icon="home" text="Home" />
          <NavItem icon="search" text="Explore" />
          <NavItem icon="comments" text="Messages" />
          <NavItem icon="bell" text="Notifications" />
        </div>

        {/* Profile Avatar */}
        <div className="relative">
          <FontAwesomeIcon
            icon="user"
            className="text-gray-500 w-6 h-6 cursor-pointer"
          />
          {/* Dropdown for Profile Options */}
        </div>
      </div>
    </nav>
  );
};

const NavItem = ({ icon, text }) => (
  <div className="flex flex-col items-center text-gray-600 hover:text-blue-500 cursor-pointer">
    <FontAwesomeIcon icon={icon} className="w-6 h-6" />
    <span className="text-xs">{text}</span>
  </div>
);

export default Navbar;
